void reset_delta() {
    int x1 = (x_curP1 - X_MIN) / 14;
    int y1 = (y_curP1 - Y_MIN) / 14;
    int x2 = (x_curP2 - X_MIN) / 14;
    int y2 = (y_curP2 - Y_MIN) / 14;
	//player 1
    if(((x_curP1 - X_MIN) % 14 == 0) && ((y_curP1 - Y_MIN) % 14 == 0)) {
        if(y1 - 1 >= 0) {
	        if(byte3==0x1D && box_struct[x1][y1-1].if_empty == true) {
		        delta_xP1 = 0;
		        delta_yP1 = -1;
	        }
        }
        if(y1 + 1 <= 15) {
	        if(byte3==0x1B && box_struct[x1][y1+1].if_empty == true) {
		        delta_xP1 = 0;
		        delta_yP1 = 1;
	        } 
        }
        
        if(x1 - 1 >= 0) {
	        if(byte3==0x1C && box_struct[x1-1][y1].if_empty == true) {
		        delta_xP1 = -1;
		        delta_yP1 = 0;
	        } 
        }
        if(x1 + 1 <= 15) {
	        if(byte3==0x23 && box_struct[x1+1][y1].if_empty == true) {
		        delta_xP1 = 1;
		        delta_yP1 = 0;
	        } 
        }
    }
	//player 2 
    if(((x_curP2 - X_MIN) % 14 == 0) && ((y_curP2 - Y_MIN) % 14 == 0)) {
        if(y2 - 1 >= 0) {
	        if (byte3 == 0x75 && box_struct[x2][y2-1].if_empty == true) {
		        delta_xP2 = 0;
		        delta_yP2 = -1;
	        }
        }
        if(y2 + 1 <= 15) {
	        if (byte3 == 0x72 && box_struct[x2][y2+1].if_empty == true) {
		        delta_xP2 = 0;
		        delta_yP2 = 1;
	        }
        }
        if(x2 - 1 >= 0) {
	        if (byte3 == 0x6B && box_struct[x2-1][y2].if_empty == true) {
		        delta_xP2 = -1;
		        delta_yP2 = 0;
	        }
        }
        if(x2 + 1 <= 15) {
	        if (byte3 == 0x74 && box_struct[x2+1][y2].if_empty == true) {
		        delta_xP2 = 1;
		        delta_yP2 = 0;
	        }
        }
    }
}

void reset_position() {
    int x1 = (x_curP1 - X_MIN) / 14;
    int y1 = (y_curP1 - Y_MIN) / 14;
    int x2 = (x_curP2 - X_MIN) / 14;
    int y2 = (y_curP2 - Y_MIN) / 14;
	//p1
	x_prepreP1 = x_preP1;
	y_prepreP1 = y_preP1;
	x_preP1 = x_curP1;
	y_preP1 = y_curP1;
	//p2
	x_prepreP2 = x_preP2;
	y_prepreP2 = y_preP2;
	x_preP2 = x_curP2;
	y_preP2 = y_curP2;
	//check P1 bound
    if((x_curP1 - X_MIN) % 14 == 0 && (y_curP1 - Y_MIN) % 14 == 0) {
	    if ((x_curP1 == X_MIN && delta_xP1 == -1) || (x_curP1 == X_MAX - 14 && delta_xP1 == 1) || (y_curP1 == Y_MIN && delta_yP1 == -1) || (y_curP1 == Y_MAX - 14 && delta_yP1 == 1)) {
		    delta_xP1 = 0;
		    delta_yP1 = 0;
	    }
        if(x1 != 0 && x1 != 15 && y1 != 0 && y1 != 15) {
            if((box_struct[x1-1][y1].if_empty == false && delta_xP1 == -1) || (box_struct[x1+1][y1].if_empty == false && delta_xP1 == 1) ||(box_struct[x1][y1-1].if_empty == false && delta_yP1 == -1) || (box_struct[x1][y1+1].if_empty == false && delta_yP1 == 1)) {
                delta_xP1 = 0;
		        delta_yP1 = 0;
            }
        }   
    }
	//check P2 bound
    if((x_curP2 - X_MIN) % 14 == 0 && (y_curP2 - Y_MIN) % 14 == 0) {
	    if ((x_curP2 == X_MIN && delta_xP2 == -1) || (x_curP2 == X_MAX - 14 && delta_xP2 == 1) || (y_curP2 == Y_MIN && delta_yP2 == -1) || (y_curP2 == Y_MAX - 14 && delta_yP2 == 1)) {
		    delta_xP2 = 0;
		    delta_yP2 = 0;
	    }
        if(x2 != 0 && x2 != 15 && y2 != 0 && y2 != 15) {
            if((box_struct[x2-1][y2].if_empty == false && delta_xP2 == -1) || (box_struct[x2+1][y2].if_empty == false && delta_xP2 == 1) ||(box_struct[x2][y2-1].if_empty == false && delta_yP2 == -1) || (box_struct[x2][y2+1].if_empty == false && delta_yP2 == 1)) {
                delta_xP2 = 0;
		        delta_yP2 = 0;
            }
        }
    }
	//P2 psotion updtae
	if(abs(delta_xP1 - delta_xP1pre) != 2 && abs(delta_yP1 - delta_yP1pre) != 2) {
		x_curP1 += delta_xP1;
		y_curP1 += delta_yP1;
	}	
	delta_xP1pre = delta_xP1;
	delta_yP1pre = delta_yP1;
	//P2 psotion updtae
	if(abs(delta_xP2 - delta_xP2pre) != 2 && abs(delta_yP2 - delta_yP2pre) != 2) {
		x_curP2 += delta_xP2;
		y_curP2 += delta_yP2;
	}
	delta_xP2pre = delta_xP2;
	delta_yP2pre = delta_yP2;
    if((x_curP1 - X_MIN) % 14 == 0 && (y_curP1 - Y_MIN) % 14 == 0) {
		if(box_struct[x1][y1].if_coin) {
			P1_score += 5;
			box_struct[x1][y1].if_coin = false;
		}
        if(box_struct[x1][y1].color != 1) {
            if(box_struct[x1][y1].color == -1) {
                P2_score--;
            }
            box_struct[x1][y1].color = 1;
            P1_score++;
        }
    }
    if((x_curP2 - X_MIN) % 14 == 0 && (y_curP2 - Y_MIN) % 14 == 0) {
		if(box_struct[x2][y2].if_coin) {
			P2_score += 5;
			box_struct[x2][y2].if_coin = false;
		}
        if(box_struct[x2][y2].color != -1) {
            if(box_struct[x2][y2].color == 1) {
                P1_score--;
            }
            box_struct[x2][y2].color = -1;
            P2_score++;
        }
    }
}

