void reset_arrows() {

	if (byte3 == 0x15 || byte3 == 0x5A) {
		finish1 = 0;
		finish2 = 0;
		return;
	}

	if (first == 1) return;

	if ((color1_cur + 1 == 6 || (color1_cur + 1 == color2_cur && color1_cur + 2 == 6)) && byte3 == 0x23) {
		finish1 = 0;
		finish2 = 0;
		return;
	}
	if ((color1_cur - 1 == -1 || (color1_cur - 1 == color2_cur && color1_cur - 2 == -1)) && byte3 == 0x1C) {
		finish1 = 0;
		finish2 = 0;
		return;
	}
	if ((color2_cur + 1 == 6 || (color2_cur + 1 == color1_cur && color2_cur + 2 == 6)) && byte3 == 0x74) {
		finish1 = 0;
		finish2 = 0;
		return;
	}
	if ((color2_cur - 1 == -1 || (color2_cur - 1 == color1_cur && color2_cur - 2 == -1)) && byte3 == 0x6B) {
		finish1 = 0;
		finish2 = 0;
		return;
	}


	if (byte3 == 0xF0) finish1 = 1;
	color1_prepre = color1_pre;
	color1_pre = color1_cur;
	if (byte3 == 0x23 && finish1 == 1) {
		if (color1_cur + 1 < 6 && color1_cur + 1 != color2_cur) {
			color1_cur++;
			finish1 = 0;
			finish2 = 0;
			return;
		}
		else if (color1_cur + 1 == color2_cur && color1_cur + 2 < 6) {
			color1_cur += 2;
			finish1 = 0;
			finish2 = 0;
			return;
		}
	}
	else if (byte3 == 0x1C && finish1 == 1) {
		if (color1_cur - 1 >= 0 && color1_cur - 1 != color2_cur) {
			color1_cur--;
			finish1 = 0;
			finish2 = 0;
			return;
		}
		else if (color1_cur - 1 == color2_cur && color1_cur - 2 >= 0) {
			color1_cur -= 2;
			finish1 = 0;
			finish2 = 0;
			return;
		}
	}

	if (byte3 == 0xF0) finish2 = 1;
	color2_prepre = color2_pre;
	color2_pre = color2_cur;
	if (byte3 == 0x74 && finish2 == 1) {
		if (color2_cur + 1 < 6 && color2_cur + 1 != color1_cur) {
			color2_cur++;
			finish1 = 0;
			finish2 = 0;
			return;
		}
		else if (color2_cur + 1 == color1_cur && color2_cur + 2 < 6) {
			color2_cur += 2;
			finish1 = 0;
			finish2 = 0;
			return;
		}
	}
	else if (byte3 == 0x6B && finish2 == 1) {
		if (color2_cur - 1 >= 0 && color2_cur - 1 != color1_cur) {
			color2_cur--;
			finish1 = 0;
			finish2 = 0;
			return;
		}
		else if (color2_cur - 1 == color1_cur && color2_cur - 2 >= 0) {
			color2_cur -= 2;
			finish1 = 0;
			finish2 = 0;
			return;
		}
	}
}

